import { BrowserRouter, Routes, Route, Navigate } from "react-router-dom";
import LoginPage from "./pages/LoginPage/LoginPage";
import StudentPage from "./pages/StudentPage/StudentPage";
import MonitoringPage from "./pages/MonitorPage/MonitoringPage";
import SessionsPage from "./pages/SessionsPage/SessionsPage";
// import HomePage from "./pages/HomePage";
// import AdminPage from "./pages/AdminPage";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        {/* <Route path="/" element={<HomePage />} /> */}
        {/* <Route path="/admin" element={<AdminPage />} /> */}
        <Route path="/student" element={<StudentPage />} />
        <Route path="/monitor" element={<MonitoringPage />} />
        <Route path="/session" element={<SessionsPage />} />
        <Route path="/login" element={<LoginPage />} />
        <Route path="/archive_viewer" element={<LoginPage />} />
        <Route path="*" element={<Navigate to="/" />} /> {/* Редирект на главную, если страница не найдена */}
      </Routes>
    </BrowserRouter>
  );
}

export default App;
